import React from 'react';
import Header from './components/core/Header';
import Menu from './components/core/Menu';
import Body from './components/core/Body';
import Footer from './components/core/Footer';


function App() {
  return (
    <div>
      <Header />
      <Menu />
      <Body />
      <Footer />
    </div>
  );
}

export default App;
